import re
import json

def extract_ids(text):
    # Padrão regex atualizado:
    # - id= seguido de um ou mais dígitos
    # - Para antes de aspas, espaços, &, > ou outros caracteres não-numéricos
    pattern = r'id=(\d+)[^\d]'
    matches = re.findall(pattern, text, re.IGNORECASE)
    
    # Encontra também IDs no final do texto (sem delimitador após)
    pattern_final = r'id=(\d+)$'
    matches += re.findall(pattern_final, text, re.IGNORECASE | re.MULTILINE)
    
    res = list(set(matches))
    res.sort(key=int)  # Ordena os IDs como números
    return res # Remove duplicatas

def save_to_json(ids, filename='ids.json'):
    with open(filename, 'w', encoding='utf-8') as f:
        json.dump({"ids": ids}, f, ensure_ascii=False, indent=2)

